import { Link } from 'react-router-dom'
import styled from 'styled-components'

export const Header = styled.header`
  margin: 0;
  padding: 0;
  display: flex;
`

export const Red = styled.section`
  width: 227.6666666666667px;
  height: 40px;
  font-size: 0.9em;
  text-align: center;
  background:#e20816;;
`

export const Orange = styled.section`
width: 227.6666666666667px;
height: 40px;
font-size: 0.9em;
text-align: center;
background:#fa6916;  
`

export const Yellow = styled.section`
width: 227.6666666666667px;
height: 40px;
font-size: 0.9em;
text-align: center;
background:#feb300; 
`

export const Green = styled.section`
width: 227.6666666666667px;
height: 40px;
font-size: 0.9em;
text-align: center;
background:#7fa01d;
`

export const Blue = styled.section`
width: 227.6666666666667px;  
height: 40px;
font-size: 0.9em;
text-align: center;
background:#0084d7; 
`

export const Purple = styled.section`
width: 227.6666666666667px;  
height: 40px;
font-size: 0.9em;
text-align: center;
background:#833074;
`

export const Styled = styled(Link)`  
height: 30px;
font-family: sans-serif;
font-size: 1.25rem;
color: #fff;
text-decoration: none;
`

export const Web = styled.section`
  width: 1000px;
  margin: 0 auto;
`
